const Stack = createNativeStackNavigator();
const Tab = createBottomTabNavigator();

function Contacts() {
  return (
    <Stack.Navigator>
      <Stack.Screen name="Contacts" component={ContactScreen} />
      <Stack.Screen name="DeleteContact" component={DeleteContactScreen} />
      <Stack.Screen name="AddContact" component={AddContactsScreen} />
      <Stack.Screen name="ContactNavigator" component={ContactNavigatorScreen} />
      <Stack.Screen name="ManageContacts" component={ManageContactScreen} />
    </Stack.Navigator>
  );
}

function Chats() {
  return (
    <Stack.Navigator>
      <Stack.Screen name="Chat" component={ChatScreen} />
      <Stack.Screen name="NewChat" component={NewChatScreen} />
      <Stack.Screen name="SendMessage" component={SendMessageScreen} />
      <Stack.Screen name="AddToChat" component={AddToChatScreen} />
      <Stack.Screen name="SingleChat" component={SingleChatScreen} />
    </Stack.Navigator>
  );
}

function Profile() {
  return (
    <Stack.Navigator>
      <Stack.Screen name="Profile" component={ProfileScreen} />
      <Stack.Screen name="EditProfile" component={UpdateProfileScreen} />
      <Stack.Screen name="Block" component={BlockedScreen} />
      <Stack.Screen name="Camera" component={CameraScreen1} />
    </Stack.Navigator>
  );
}

function MainTabs() {
  return (
    <Tab.Navigator>
      <Tab.Screen name="Contacts" component={Contacts} options={{ headerShown: false }} />
      <Tab.Screen name="Chat" component={Chats} options={{ headerShown: false }} />
      <Tab.Screen name="Profile" component={Profile} options={{ headerShown: false }} />
    </Tab.Navigator>
  );
}

function MainStack() {
  return (
    <Stack.Navigator>
      <Stack.Screen name="Main" component={MainTabs} options={{ headerShown: false }} />
      <Stack.Screen name="Login" component={LoginScreen} />
      <Stack.Screen name="Signup" component={SignupScreen} />
    </Stack.Navigator>
  );
}

export default class App extends Component {
  render() {
    return (
      <NavigationContainer>
        <MainStack />
      </NavigationContainer>
    );
  }
}
